    /**
     * 일반 문자열을 지정된 키를 이용하여 AES256 으로 암호화( C#과 호환성 확인 완료)
     * @param  String - 암호화 대상 문자열
     * @param  String - 문자열 암호화에 사용될 키
     * @return String - key 로 암호화된  문자열
     * @exception
     */
    private String strEncode(String str, String key) throws java.io.UnsupportedEncodingException, NoSuchAlgorithmException, NoSuchPaddingException, InvalidKeyException, InvalidAlgorithmParameterException, IllegalBlockSizeException,
            BadPaddingException {

        key = key + this.dtEncKey;

        if(key.length() > 32) key = key.substring(0, 32);
        byte[] textBytes = null;
        AlgorithmParameterSpec ivSpec = null;
        SecretKeySpec newKey = null;
        Cipher cipher = null;
        String msg = "";


        try {
            textBytes = str.getBytes("UTF-8");
            ivSpec = new IvParameterSpec(ivBytes);
            newKey = new SecretKeySpec(key.getBytes("UTF-8"), "AES");
            cipher = null;
            cipher = Cipher.getInstance("AES/CBC/PKCS5Padding");
            cipher.init(Cipher.ENCRYPT_MODE, newKey, ivSpec);
            msg = Base64.encodeBase64String(cipher.doFinal(textBytes));
        } finally {
            textBytes = null;
            ivSpec = null;
            newKey = null;
            cipher = null;
        }

        return msg;
    }

    /**
     * 암호화된 문자열을 지정된 키를 이용하여 AES256 으로 복호화( C#과 호환성 확인 완료)
     * @param  String - 복호화 대상 문자열
     * @param  String - 문자열 복호화에 사용될 키
     * @return String - key 로 복호화된  문자열
     * @exception
     */
    private String strDecode(String str, String key) throws java.io.UnsupportedEncodingException, NoSuchAlgorithmException, NoSuchPaddingException, InvalidKeyException, InvalidAlgorithmParameterException, IllegalBlockSizeException,
            BadPaddingException {

        key = key + this.dtEncKey;
        if(key.length() > 32) key = key.substring(0, 32);

        byte[] textBytes = null;
        AlgorithmParameterSpec ivSpec = null;
        SecretKeySpec newKey = null;
        Cipher cipher = null;
        String msg = "";

        try {
            //byte[] textBytes = str.getBytes("UTF-8");
            textBytes = Base64.decodeBase64(str);
            ivSpec = new IvParameterSpec(ivBytes);
            newKey = new SecretKeySpec(key.getBytes("UTF-8"), "AES");
            cipher = Cipher.getInstance("AES/CBC/PKCS5Padding");
            cipher.init(Cipher.DECRYPT_MODE, newKey, ivSpec);

            msg = new String(cipher.doFinal(textBytes), "UTF-8");
        } finally {
            textBytes = null;
            ivSpec = null;
            newKey = null;
            cipher = null;
        }

        return msg;
    }

    private String getDateTimeStr() {
        Date now = new Date();
        SimpleDateFormat sdfDate = new SimpleDateFormat("yyyyMMddHHmmssSSS", Locale.KOREA);//dd/MM/yyyy

        String strDate = sdfDate.format(now);

        now = null;
        sdfDate = null;
        // 연도+월+일+시간+분+초+밀리 세컨드
        return (strDate);
    }//getDateTimeStr

    // 기능 : 호출 문자열의 hmac를 구함
    //  - 장보고 쪽의 .NET으로 된 모듈과 동일한 처리 로직임. 즉 변경 시, .NET쪽도 변경 필요(19.08.22)
    public String hamc(String data) {
        String retVal = "";
        String curTime = this.getDateTimeStr(); // 호출 시간
        long keyInx = Long.parseLong(curTime); // 호출 시간 암호화 key를 얻익 위하여 key index 를 구함


        // -key의 복잡도를 높이기 위하여, 호출 시간 문자열을 추가함
        String secretAccessKey = getKey(keyInx) + curTime; //data  hamc  solat 값을 생성함 ( 시간 기반 암호화  key + 시간(ms단위) 문자열  )
        String hamcStr = "";

        byte[] secretKey = null;
        SecretKeySpec signingKey = null;
        Mac mac = null;

        byte[] bytes = null;
        byte[] rawHmac = null;
        try {

            // - 데이타 복잡도를 높이기 위하여, 호출 시간 문자열을 추가함
            String msgTxt = data + curTime;

            //data의 hamc를 구함( SHA256 이용)
            secretKey = secretAccessKey.getBytes("UTF-8");
            signingKey = new SecretKeySpec(secretKey, "HmacSHA256");
            mac = Mac.getInstance("HmacSHA256");
            mac.init(signingKey);
            bytes = msgTxt.getBytes("UTF-8");
            rawHmac = mac.doFinal(bytes);

            hamcStr = Base64.encodeBase64String(rawHmac);

            //시간 문자열의 암호화  key  index  구함
            String timeEncKeyInx = curTime.substring(14, 17);

            //
            //key index의 역활을 하는 시간 문자열과 hash값을 결합한 문자열을 생성함.
            // [호출 시간 (암호화)] + [호출 시간 암호화  key 인덱스] + [//](구분자)  + [data hamc]
            hamcStr = strEncode(curTime, getKey(Long.parseLong(timeEncKeyInx))) + timeEncKeyInx + "//" + hamcStr;

            //http get 방식으로 hmac 전달 시, 공백으로 전달되는 현상이 발생하여 이를 방지하기 위하여 '+'기회를 '_'로 변경함(19.08.30)
            // - base64 인코딩 시, '_'가 나올 수 없음.
            hamcStr = hamcStr.replace("+", "_");

        } catch(Exception ex) {
        } finally {
            secretKey = null;
            signingKey = null;
            mac = null;
            bytes = null;
            rawHmac = null;
        }

        return hamcStr;
    }//hamc





    //데이타와 hmac 문자열을 받아서, 변경이 없었는지 확인함.
    // - 성공 시 공백 , 실패 시 에러 메세지
    //  - 장보고 쪽의 .NET으로 된 모듈과 동일한 처리 로직임. 즉 변경 시, .NET쪽도 변경 필요(19.08.22)
    public String chkHmac(String hmacStr, String data) {
        String msg = "";

        byte[] secretKey = null;
        SecretKeySpec signingKey = null;
        Mac mac = null;

        byte[] bytes = null;
        byte[] rawHmac = null;
        String StrChkHmacStr = ""; //검증을 위하여, 생성한 hmac

        //http get 방식으로 hmac 문자열 전달 시, 공백으로 전달되는 현상이 발생하여 이를 방지하기 위하여 '+'기회를 '_'로 변경한 것을 원복 시킴(19.08.30)
        hmacStr = hmacStr.replace("_", "+");

        try {
            String timeEncKeyInx = hmacStr.substring(hmacStr.indexOf("//") - 3, hmacStr.indexOf("//"));// 시간 암호화 key  인덱스
            String callTimeEnc = hmacStr.substring(0, hmacStr.indexOf("//") - 3); //    암호화된 호출 시간(ms단위)
            String orginHamcStr = hmacStr.substring(hmacStr.indexOf("//") + 2, hmacStr.length()); // hmacStr내에서 실제 data의 hmac 값을 구함


            String callTime = this.strDecode(callTimeEnc, getKey(Long.parseLong(timeEncKeyInx))); //호출 시간 암호화 해독
            String curTime = this.getDateTimeStr(); //호출 hmac 생성 이후, 경과 시간을 알기 위하여 현재 시간을 구함.


            //검증을 한 ,  hmac 생성
            // - 데이타 복잡도를 높이기 위하여, 호출 시간 문자열을 추가함
            String msgTxt = data + callTime;
            long keyInx = Long.parseLong(callTime);

            // -key의 복잡도를 높이기 위하여, 호출 시간 문자열을 추가함
            String secretAccessKey = getKey(keyInx) + callTime;
            secretKey = secretAccessKey.getBytes("UTF-8");
            signingKey = new SecretKeySpec(secretKey, "HmacSHA256");
            mac = Mac.getInstance("HmacSHA256");
            mac.init(signingKey);
            bytes = msgTxt.getBytes("UTF-8");
            rawHmac = mac.doFinal(bytes);

            StrChkHmacStr = Base64.encodeBase64String(rawHmac);



            //시간 경과 확인 (	100000 = 1분)
            if(Long.parseLong(curTime) > (Long.parseLong(callTime) + 500000)) {
                msg = "잘못된 호출 입니다.(유효 시간(5분) 경과)";
            } else if(!StrChkHmacStr.equals(orginHamcStr)) {
                msg = "잘못된 호출 입니다.(메세지 인증 실패).";
            }



        } catch(Exception ex) {
            msg = "실패(" + ex.getMessage() + ")";
        } finally {
            secretKey = null;
            signingKey = null;
            mac = null;
            bytes = null;
            rawHmac = null;
        }
        return msg;

    }


